import {Link} from 'react-router-dom';

function Menu() {
  return (
        <div className='main'>
        <div className='dropdown-button'>
            <button onClick={null}>Dripdrown</button>
            <div className='dropdown-content'>
                <a href='#'>
                    <Link to="./App.js">main page</Link>
                </a>
                <a href='#'>2</a>
                <a href='#'>3</a>
            </div>
        </div>
        </div>
    );
}

export default Menu
